import React from 'react';
import Paper from "@material-ui/core/Paper";

const Question = ({question, getQuestionId}) => {

    const q = getQuestionId(question);
    console.log(q);
    return(
        <Paper>
            <h1>Detail's page</h1>  
                <p>{q.title}</p>
        </Paper>
    )
}
export default Question;
